// @flow

import React, { Component } from "react";
import { NavLink } from "react-router-dom";

// import all the necessary subcomponents
import Loader from '../Loader';

// importing the style from the external css file
import "./navbar.css";

import IconExchange from '../../images/exchange.svg';
import IconLogo from '../../images/logo.png';


// declaring the type of states and props used
type Props = {};
type State = {
  freelancerList: Array<Object>,
  searchType: string,
  searchValue: string,
  dataInProgress: boolean,
};

class Navbar extends Component<Props, State> {
  constructor(props) {
    super(props);
    this.state = {

    };

    //  binding all the necessary functions to perform state operations
    (this: any).handleSearchTypeChange = this.handleSearchTypeChange.bind(this);
  }
  componentDidMount() {
    // fetching the necessary data from the api
    fetch('https://reqres.in/api/users?page=1')
    .then(response => response.json())
    .then(data_list => this.setState(prevState=>({
      freelancerList: data_list.data,
      dataInProgress: false,
      })));
  }

  // handling on change for select box in the search area (first name, last name, email)
  handleSearchTypeChange(e) {
    console.log('koko');
  }

  render() {

    return (
      <div className="navbar-section">
        <div className="nav-link-section">
          <div className="nav-logo-container">
            <img alt="img" className="nav-logo" src={IconLogo} />
          </div>
          <NavLink
            to="/dashboard/exchange"
            className="nav-link"
            activeClassName="nav-link-active"
          >
            <i className="nav-link-icon" className="material-icons">sync</i>
            Exchange
          </NavLink>
          <NavLink to="/dashboard/orders" className="nav-link"
          activeClassName="nav-link-active" >
            <img alt="img" src={IconExchange} className="nav-link-icon" />
            My Orders
          </NavLink>
          <NavLink to="/dashboard/track" className="nav-link"
          activeClassName="nav-link-active" >
            <img alt="img" src={IconExchange} className="nav-link-icon" />
            Track Orders
          </NavLink>
          <NavLink to="/dashboard/products" className="nav-link"
          activeClassName="nav-link-active" >
            <img alt="img" src={IconExchange} className="nav-link-icon" />
            Products
          </NavLink>
          <NavLink to="/dashboard/refer" className="nav-link"
          activeClassName="nav-link-active" >
            <img alt="img" src={IconExchange} className="nav-link-icon" />
            Refer and Earn $5
          </NavLink>
        </div>
        <div className="nav-link-section">
          <div className="nav-button nav-button-active">
            Login
          </div>
          <div className="nav-button">
            Priority Support
          </div>
          <div className="nav-button">
            Go to Old Website
          </div>
          <div className="nav-button">
            Share your feedback
          </div>
        </div>
      </div>
      );
  }
}

export default Navbar;
